

select setval('users_type_id_seq', (SELECT MAX(id) FROM users_type));


select setval('domains_id_seq', (SELECT MAX(id) FROM domains));


select setval('groups_id_seq', (SELECT MAX(id) FROM groups));


select setval('acl_sid_id_seq', (SELECT MAX(id) FROM acl_sid));


select setval('acl_class_id_seq', (SELECT MAX(id) FROM acl_class));


select setval('template_id_seq', (SELECT MAX(id) FROM template));


select setval('publish_location_id_seq', (SELECT MAX(id) FROM publish_location));


select setval('acl_object_identity_id_seq', (SELECT MAX(id) FROM acl_object_identity));

select 4
	, publish_location.id
	, acl_sid.id
	, '1'
from publish_location, acl_sid
where acl_sid.sid = 'ROLE_ADMIN';

select 5
	, template.id
	, acl_sid.id
	, '1'
from template, acl_sid
where acl_sid.sid = 'ROLE_ADMIN';


select acl_object_identity.id
	, 0
	, acl_sid.id
	, 2
	, '1'
	, '0'
	, '0'
from acl_object_identity, acl_sid
where acl_sid.sid = 'ROLE_ADMIN'
and acl_object_identity.object_id_class = 5;

select acl_object_identity.id as acl_object_identity
	, 1 as ace_order
	, acl_sid.id
	, 2 as mask
	, '1' as granting
	, '0' as audit_success
	, '0' as audit_failure
from template, acl_object_identity, acl_sid
where template.template_pid in ('tmplt:1', 'tmplt:2', 'tmplt:3', 'tmplt:4', 'tmplt:5')
and acl_object_identity.object_id_class = 5
and acl_object_identity.object_id_identity = template.id
and acl_sid.sid = 'ROLE_ANU_USER';

select acl_object_identity.id as acl_object_identity
	, 0 as ace_order
	, acl_sid.id
	, 64 as mask
	, '1' as granting
	, '0' as audit_success
	, '0' as audit_failure
from publish_location, acl_object_identity, acl_sid
where acl_object_identity.object_id_class = 4
and acl_object_identity.object_id_identity = publish_location.id
and acl_sid.sid = 'ROLE_ADMIN';

select acl_object_identity.id as acl_object_identity
	, 1 as ace_order
	, acl_sid.id
	, 64 as mask
	, '1' as granting
	, '0' as audit_success
	, '0' as audit_failure
from publish_location, acl_object_identity, acl_sid
where publish_location.code in ('ANU', 'ANDS')
and acl_object_identity.object_id_class = 4
and acl_object_identity.object_id_identity = publish_location.id
and acl_sid.sid = 'ROLE_ANU_USER';





-- Activity

SELECT 'Activity' as category1
	,'Activity' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','hasPart','isPartOf');

SELECT 'Activity' as category1
	,'Collection' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','hasOutput');

SELECT 'Activity' as category1
	,'Party' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','isFundedBy','isManagedBy','hasParticipant','hasPrincipalInvestigator');

SELECT 'Activity' as category1
	,'Service' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith');

-- Collection

SELECT 'Collection' as category1
	,'Activity' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','isOutputOf');

SELECT 'Collection' as category1
	,'Collection' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','describes','hasPart','isDescribedBy'
	,'isLocatedIn','isLocationFor','isPartOf','isDerivedFrom','hasDerivedCollection');

SELECT 'Collection' as category1
	,'Party' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','hasCollector','isManagedBy','isOwnedBy','isEnrichedBy', 'hasPrincipalInvestigator');

SELECT 'Collection' as category1
	,'Service' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','supports','isAvailableThrough','isProducedBy',
	'isPresentedBy','isOperatedOnBy','hasValueAddedBy');

-- Party

SELECT 'Party' as category1
	,'Activity' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','isParticipantIn','isFundedBy','isFunderOf',
	'isManagedBy','isManagerOf','isOwnedBy','isOwnerOf','isPrincipalInvestigatorOf');

SELECT 'Party' as category1
	,'Collection' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','enriches','isCollectorOf',
	'isManagedBy','isManagerOf','isOwnedBy','isOwnerOf','isPrincipalInvestigatorOf');

SELECT 'Party' as category1
	,'Party' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','hasMember','hasPart','isPartOf','isMemberOf','isFundedBy',
	'isFunderOf','isManagedBy','isManagerOf','isOwnedBy','isOwnerOf');

SELECT 'Party' as category1
	,'Service' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','isManagedBy','isManagerOf','isOwnedBy','isOwnerOf');

-- Service

SELECT 'Service' as category1
	,'Activity' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith');

SELECT 'Service' as category1
	,'Collection' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','isSupportedBy','makesAvailable','produces','presents',
	'operatesOn','addsValueTo');

SELECT 'Service' as category1
	,'Party' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','isManagedBy','isOwnedBy');

SELECT 'Service' as category1
	,'Service' as category2
	,link_type.id as link_type_id
FROM link_type
WHERE link_type.code IN ('hasAssociationWith','hasPart','isPartOf');


