select t.id
	, pl.id
from template t, publish_location pl
where pl.code = 'ANU';

select t.id
	, pl.id
from template t, publish_location pl
where pl.code = 'ANDS'
and t.name != 'PAMBU Author Template';

select t.id
	, pl.id
from template t, publish_location pl
where pl.code = 'PAMBU'
and t.name in ('PAMBU Author Template', 'PAMBU Collection Template');

select t.id
	, pl.id
from template t, publish_location pl
where pl.code = 'IRIS'
and t.name = 'Collection Template';

